import React from "react";
import { Card } from "antd";

interface SpaceCardProps {
  space: { id: number; name: string; price: string; image: string };
}

export const SpaceCard: React.FC<SpaceCardProps> = ({ space }) => {
  return (
    <Card hoverable cover={<img alt={space.name} src={space.image} />}>
      <h3>{space.name}</h3>
      <p>{space.price}</p>
    </Card>
  );
};
